1 &lt;/li&gt;\n          &lt;li&gt; Threads: 1 &lt;/li&gt;\n          &lt;li&gt; Memory: 14.90 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\nfrom dask import delayed\n\nfrom dask.distributed import performance_report\n\nimport logging\nlogging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\nimport argparse\nparser = argparse.ArgumentParser()\nparser.add_argument(\"-c\", \"--cores\", type=int, default=4)\nparser.add_argument(\"-N\", \"--Nodes\", type=int, default=1)\nparser.add_argument(\"-f\", \"--files\", type=int, default=100)\nparser.add_argument(\"-p\", \"--pts\", type=int, default=400)\nargs = parser.parse_args()\n\n#import pdb; pdb.set_trace()\n\ncluster = SLURMCluster(memory='{}g'.format(16*args.cores),\n                       processes=args.cores,\n                       cores=args.cores,\n                       queue='photon',\n                       #python='python',\n                       local_directory='/tmp/ikabadzh',\n                       header_skip=['-n 1', '-t 00:30:00'],\n                       job_extra=['--ntasks-per-node=1', '-t 8:00:00'])\n\n#import pdb; pdb.set_trace()\ncluster.scale(jobs=args.Nodes)\n#print(cluster.get_logs())\nclient = Client(cluster)\n\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\n\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\n        \"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\n        \"Dimuon_mass\",\n        \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\n        \"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    # Create canvas for plotting\n    ROOT.gStyle.SetOptStat(0)\n    ROOT.gStyle.SetTextFont(42)\n    c = ROOT.TCanvas(\"c\", \"\", 800, 700)\n    c.SetLogx()\n    c.SetLogy()\n\n    client.wait_for_workers(args.Nodes)\n    watch = ROOT.TStopwatch()\n    hist.GetValue() # triggers the event loop\n    elapsed = watch.RealTime()\n    file_out = open('../../distrdf_timestamps.out', 'a')\n    file_out.write(\"\\ncores={} Nodes={}: Event Loop={}s\\n\".format(args.cores, args.Nodes, elapsed))\n    file_out.close()\n\n    # Draw histogram\n    hist.GetXaxis().SetTitle(\"m_{#mu#mu} (GeV)\")\n    hist.GetXaxis().SetTitleSize(0.04)\n    hist.GetYaxis().SetTitle(\"N_{Events}\")\n    hist.GetYaxis().SetTitleSize(0.04)\n    hist.SetStats(False)\n    hist.Draw()\n\n    # Draw labels\n    label = ROOT.TLatex()\n    label.SetTextAlign(22)\n    label.DrawLatex(0.55, 3.0e4, \"#eta\")\n    label.DrawLatex(0.77, 7.0e4, \"#rho,#omega\")\n    label.DrawLatex(1.20, 4.0e4, \"#phi\")\n    label.DrawLatex(4.40, 1.0e5, \"J/#psi\")\n    label.DrawLatex(4.60, 1.0e4, \"#psi'\")\n    label.DrawLatex(12.0, 2.0e4, \"Y(1,2,3S)\")\n    label.DrawLatex(91.0, 1.5e4, \"Z\")\n    label.SetNDC(True)\n    label.SetTextAlign(11)\n    label.SetTextSize(0.04)\n    label.DrawLatex(0.10, 0.92, \"#bf{CMS Open Data}\")\n    label.SetTextAlign(31)\n    label.DrawLatex(0.90, 0.92, \"#sqrt{s} = 8 TeV, L_{int} = 11.6 fb^{-1}\")\n\n    # Save Canvas to image\n    c.SaveAs(\"dimuonSpectrum.png\")\n\nif __name__ == '__main__':\n    #filelist = [\"/hpcscratch/user/ikabadzh/works/BENCH2/input_files/dimuon/f{}.root\".format(i) for i in range(1,1001)]\n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, args.files+1)]\n    df = RDataFrame(\"Events\", filelist, npartitions=(args.pts), daskclient=client)\n    \n    for i in range(3):\n      with performance_report(filename=\"dask-report_{}.html\".format(i)):\n        dimuonSpectrum(df)\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"format":"0.0 b"},"id":"1177","type":"NumeralTickFormatter"},{"attributes":{},"id":"1451","type":"CategoricalTickFormatter"},{"attributes":{},"id":"1159","type":"CategoricalScale"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{},"id":"1452","type":"AllLabels"},{"attributes":{"factors":["a","b"]},"id":"1155","type":"FactorRange"},{"attributes":{"factors":["a","b"]},"id":"1157","type":"FactorRange"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth by Worker"},"id":"1153","type":"Title"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"1451"},"group":null,"major_label_orientation":-0.3490658503988659,"major_label_policy":{"id":"1452"},"ticker":{"id":"1164"}},"id":"1163","type":"CategoricalAxis"},{"attributes":{"axis":{"id":"1163"},"coordinates":null,"group":null,"ticker":null},"id":"1165","type":"Grid"},{"attributes":{"child":{"id":"1400"},"title":"Scheduler Logs"},"id":"1410","type":"Panel"},{"attributes":{"tools":[{"id":"1179"}]},"id":"1169","type":"Toolbar"},{"attributes":{},"id":"1161","type":"CategoricalScale"},{"attributes":{},"id":"1164","type":"CategoricalTicker"},{"attributes":{"coordinates":null,"formatter":{"id":"1447"},"group":null,"major_label_policy":{"id":"1448"},"ticker":{"id":"1167"}},"id":"1166","type":"CategoricalAxis"},{"attributes":
